import React from "react";
import "./App.css";
import Header from "./Header";
import Home from "./Home";
import {BrowserRouter as Router, Switch , Route } from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>

        <Route Path="/route">
          <Header />
          <h1>THis is Route : working 100%</h1>
        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
